import React from 'react';
import styled from 'styled-components';

const MainItemBlock = styled.div`
  display: flex;
  border-top: 1px solid ${palette.gray[7]};
  margin-top: 50px;
  .h1 {
    font-size: 100px;
    color: black;
  }
`;

const MainItem = ({ item }) => {
  const {
    stateDt,
    decideCnt,
    deathCnt,
    examCnt,
    clearCnt,
    resutlNegCnt,
    careCnt,
    accExamCnt,
  } = item;

  return (
    <MainItemBlock>
      <p>{stateDt}</p>,<p>{decideCnt}</p>, <p>{deathCnt}</p>, <p>{examCnt}</p>,{' '}
      <p>{clearCnt}</p>,<p>{resutlNegCnt}</p>,<p>{careCnt}</p>,{' '}
      <p>{accExamCnt}</p>
    </MainItemBlock>
  );
};

export default MainItem;
